import React from 'react';
import {tabBar} from "../constant/constant";
interface props {
    tab:Object
}
const Taskcontrol:React.FC<props> = ({tab}) => {

    switch (tab)
    {
        case tabBar.files:
    }
    return (
        <div></div>
    );
}

export default Taskcontrol;
